import axios from 'axios';

export async function getUser(userId) {
    console.log("[US] [GET] START: " + userId);
    const headers = {
        'Content-Type': 'application/json'
    };
    let success = await axios.post('http://localhost:8000/event', userId, headers)
    .then(response => success = response
    ).catch(function(err) {
       console.log("[US] [GET] ERROR: " + err); 
       return err;
    }).then(function () {
        // always executed
        console.log('[US] [GET] SUCCESS: ' + success);
        console.log("[US] [GET] COMPLETE");  
        return success;
      });
      return success;
}
